    YOW += y[9]*imw[9]; /*CO */
    YOW += y[10]*imw[10]; /*CH3 */
    YOW += y[11]*imw[11]; /*CH2O */
    YOW += y[12]*imw[12]; /*CO2 */
    YOW += y[13]*imw[13]; /*CH4 */
    YOW += y[14]*imw[14]; /*C2H2 */
